import React, {Component} from 'react';
import './index.css';

class TableStudents extends Component {
	constructor(props) {
		super(props);
		this.students = [
			{
				'avatar': null,
				'fullname': 'Иванов Иван Иванович',
				'specialty': 'Прикладная информатика',
				'group': 'ПИ-101',
				'age': 21,
				'rating': 65,
				'color': '#f00',
			},
		]
	}

	render(props) {
		return (
			<table className="table-students">
				<thead className="column-names">
					<tbody id="avatar"></tbody>
					<tbody id="fullname">ФИО</tbody>
					<tbody id="specialty">Специальность</tbody>
					<tbody id="group">Группа</tbody>
					<tbody id="age">Возраст</tbody>
					<tbody id="rating">Рейтинг</tbody>
					<tbody id="color"></tbody>
					<tbody id="delete"></tbody>
				</thead>

			</table>
		);
	}



}

export default TableStudents
